import React from 'react';

const Biography = () => {
    return (
        <section>
            <h2>Біографія</h2>
            <section>
                <h3>Як я вирішив обрати IT та фронт-енд розробку</h3>
                <p>Ви колись мали відчуття, що ви ніби все робите правильно, йдете до своєї мрії, але щось не так?
                І ви ніяк не можете зрозуміти, що саме. Ось одно
                </p>
            </section>
            <section>
                <h3>Досвід роботи на навчання</h3>
            </section>
        </section>
    )
};

export default Biography;
